const METADATA = {
    website: "https://github.com/WaffleDevsAlt/Shapez.io-Mods",
    author: "WaffleDevs",
    name: "1x1 stacker",
    version: "1.0.0",
    id: "1x1 stacker",
    description: "Adds 1x1 versions of the stacker building",
    minimumGameVersion: ">=1.5.0",
};


class Meta1x1Stacker extends shapez.ModMetaBuilding {
    constructor() {
        super("1x1stacker");
    }

    static getAllVariantCombinations() {
        return [
            {
                variant: shapez.defaultBuildingVariant,
                name: "1x1 Stacker",
                description: "The stacker building, but 1x1",

                regularImageBase64: RESOURCES["1x1stacker.png"],
                blueprintImageBase64: RESOURCES["1x1stackerBlueprint.png"],
                tutorialImageBase64: RESOURCES["1x1stackerBlueprint.png"],
            },
        ];
    }

    getSilhouetteColor() {
        return "#9fcd7d";
    }

    getDimensions() {
        return new shapez.Vector(1,1);
    }

    getAdditionalStatistics(root) {
        const speed = root.hubGoals.getProcessorBaseSpeed(shapez.enumItemProcessorTypes.stacker);
        return [[shapez.T.ingame.buildingPlacement.infoTexts.speed, shapez.formatItemsPerSecond(speed)]];
    }

    getIsUnlocked(root) {
        return root.hubGoals.isRewardUnlocked(shapez.enumHubGoalRewards.reward_stacker);
    }

    setupEntityComponents(entity) {
        entity.addComponent(
            new shapez.ItemProcessorComponent({
                inputsPerCharge: 2,
                processorType: shapez.enumItemProcessorTypes.stacker,
            })
        );

        entity.addComponent(
            new shapez.ItemEjectorComponent({
                slots: [{ pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.top }],
            })
        );
        entity.addComponent(
            new shapez.ItemAcceptorComponent({
                slots: [
                    {
                        pos: new shapez.Vector(0, 0),
                        direction: shapez.enumDirection.right,
                        filter: "shape",
                    },
                    {
                        pos: new shapez.Vector(0, 0),
                        direction: shapez.enumDirection.left,
                        filter: "shape",
                    },
                ],
            })
        );
    }
}

class Mod extends shapez.Mod {
    init() {
        this.modInterface.registerNewBuilding({
            metaClass: Meta1x1Stacker,
            buildingIconBase64: RESOURCES["1x1stackerIcon.png"],
        });
        this.modInterface.addNewBuildingToToolbar({
            toolbar: "regular",
            location: "secondary",
            metaClass: Meta1x1Stacker,
        });
    }
}

const RESOURCES = {
    "1x1stacker.png":
        "data:image/png;base64,",
    "1x1stackerIcon.png":
        "data:image/png;base64,",
    "1x1stackerBlueprint.png":
        "data:image/png;base64,",
}
